import style from '../Style/App_module'

export default function Header(){
    const dataTime = new Date()

    return(
    <header> 
        <div className={style.item}>
            <img src='./logo.jpg' alt="FreeBot"   />
            <span>Время сейчас: {dataTime.toLocaleTimeString()}</span>   
        </div>
        
    </header>
    )
}
